import React from 'react';
import './Piece.css';

const Piece = ({ color, type }) => {
  const pieceClass = `piece ${color}-${type}`;
  const pieceSrc = `/assets/${color}-${type}.png`;

  return <img src={pieceSrc} alt={`${color} ${type}`} className={pieceClass} />;
};

export default Piece;
